import React from "react";

const ProfileImage = () => {
  return (
    <img
      className="ellipse-shape-icon"
      alt="icon"
      src="https://cdn.pixabay.com/photo/2024/01/10/16/20/woman-8499928_1280.jpg"
    />
  );
};

export default ProfileImage;
